import React from "react";
import { Button, Grid, InputAdornment, IconButton } from "@mui/material";
import TextField from "@mui/material/TextField";
import { PlayArrow } from "@mui/icons-material";

function VideoForm(props) {
    return (
        <Grid
            container
            spacing={1}
            my={1}
            justifyContent={"space-between"}
            alignItems={"center"}
        >
            <Grid item xs>
                endAdornment=
                {
                    <InputAdornment position="end">
                        <IconButton
                            aria-label="toggle password visibility"
                            onClick={handleClickShowPassword}
                            onMouseDown={handleMouseDownPassword}
                            edge="end"
                        >
                            {values.showPassword ? (
                                <VisibilityOff />
                            ) : (
                                <Visibility />
                            )}
                        </IconButton>
                    </InputAdornment>
                }
                <TextField
                    name="videoUrl"
                    type="text"
                    label="Vimeo video URL"
                    variant="outlined"
                    size="small"
                    error={!props.videoFormConfig.videoUrl}
                    helperText={
                        props.videoFormConfig.videoUrl
                            ? ""
                            : "Please enter a URL"
                    }
                    onChange={props.handleFormChange}
                    value={props.videoFormConfig.videoUrl}
                    fullWidth
                />
            </Grid>
            <Grid item xs="auto">
                <Button
                    variant="contained"
                    color="primary"
                    size="medium"
                    disabled={!props.videoFormConfig.videoUrl}
                    onClick={props.handleFormSubmit}
                    fullWidth
                >
                    Load
                </Button>
            </Grid>
        </Grid>
    );
}

export default VideoForm;
